import { Component } from "react";
import axios from 'axios'

class Upload extends Component {


  state = {
    file: null
  }

//objeto SSD
 ssd = {
  brand: '',
  model : '',
  serialNumber : '',
  size : '',
  purchasePrice :'',
  purchaseDate : '',
  saleValue : '',
  arrivalDate :''

}

//  category = {
//   productCategory : ''
// }

  handleFile(e) {

let file = e.target.files[0]

    console.log(e.target.files, "$$$$");
    console.log(e.target.files[0], "$$$$");
    console.log(e.target.brand)
    this.setState({img_file: file})
}

handleUpload(e){
console.log(this.state,"TESTE DE ESTADO ---- $$$$");

let file = this.state.file
let formdata = new FormData()

formdata.append('image',this.state.img_file);
formdata.append('name',"dinho");

axios({
  // url:'http://localhost:9090/ssd/list',
  url: "http://localhost:9090/ssd",
  method: "POST",
  headers: {
    "Content-type": "multipart/form-data",
    Accept: "application/json",
  },
  data: formdata,
}).then(
  (res) => {
    if (res.ok) {
      alert("Perfect! ");
    } else if (res.status == 401) {
      alert("Oops! ");
    }
  },
  function (e) {
    alert("Error submitting form!");
  }
);


}
render(){
  return (
    <div className="Upload">
      <h2>FORM</h2>

      <form>
        <div className="">
          <label>FILE</label>
          <input type="file" name="file" onChange={(e) => this.handleFile(e)} />

          <div className="col-md-6 offset-md-3">
            <input
              type="text"
              // value={ssd}
              // onChange={eventoTeste}
              name="brand"
              className="form-control"
              placeholder="Brand"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type="text"
              name="model"
              className="form-control"
              placeholder="Model"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type="text"
              name="serialNumber"
              className="form-control"
              placeholder="Serial number"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type="text"
              name="size"
              className="form-control"
              placeholder="Size"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type="text"
              name="purchasePrice"
              className="form-control"
              placeholder="Purchase price"
            />
          </div>
          <div className=" col-md-6 offset-md-3">
            <input
              type="text"
              name="saleValue"
              className="form-control"
              placeholder="Sale value"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type="text"
              name="purchaseDate"
              className="form-control"
              placeholder="Purchate date"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type="text"
              name="arrivalDate"
              className="form-control"
              placeholder="Arrival date"
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type="text"
              name="productCategory"
              className="form-control"
              placeholder="Category"
            />
          </div>
          <div className="botao">
            {/* {botao ? ( */}
            <input
              type="button"
              // onClick={cadastrar}
              className="btn btn-success"
              value="Cadastrar"
            />
            {/* ) : ( */}
            <div>
              <input
                type="button"
                className="btn btn-secondary"
                value="InÃ­cio"
              />
              <input type="button" className="btn btn-dark" value="Pesquisar" />
              <input type="button" className="btn btn-primary" value="Listar" />
            </div>

          </div>
        </div>
      </form>

      <button type="button" onClick={(e) => this.handleUpload(e)}>
        enviar
      </button>
    </div>
  );
}
}


export default Upload;
